import React,{useState} from 'react'
import { Menu } from 'antd';
import { MailOutlined, AppstoreOutlined, SettingOutlined,UserOutlined,UserAddOutlined,LogoutOutlined  } from '@ant-design/icons';
import {Link} from "react-router-dom"
import "bootstrap/dist/css/bootstrap.min.css";
import firebase from 'firebase/compat/app';
import { useDispatch } from 'react-redux';
import { useNavigate } from 'react-router-dom';



const { SubMenu,Item } = Menu;

const Header = () => {
    let dispatch=useDispatch();
    const navigate=useNavigate()
    const[current,setCurrent]=useState('home')
    const logout=()=>{
        firebase.auth().signOut()
        dispatch({
          type: "LOGGED_OUT",
          payload : null
            
          
        })
navigate('/login')

    }
    const handleClick=(e)=>{
        setCurrent(e.key)

    }
    
    return (
        <>
        
        <Menu onClick={handleClick} selectedKeys={[current]} mode="horizontal">
             <Menu.Item key="home" icon={<AppstoreOutlined/>}>
          <Link to="/">Home</Link>
        </Menu.Item>
        <SubMenu key="SubMenu" icon={<SettingOutlined />} title="Username">
        
          <Menu.ItemGroup title="Item 1">
            <Menu.Item key="setting:1">Option 1</Menu.Item>
            <Menu.Item key="setting:2">Option 2</Menu.Item>
            <Item  icon={LogoutOutlined} onClick={logout}>Log Out</Item>
          </Menu.ItemGroup>
          
        </SubMenu>
        <Menu.Item key="register" icon={<UserAddOutlined />} style={{position : "absolute",right :"15px"}}>
        <Link to="/register">Register</Link>
        </Menu.Item>
        <Menu.Item key="Login" icon={<UserOutlined />} style={{position : "absolute",right :"120px"}}>
        <Link to="/login">Login</Link>
        </Menu.Item>
        
       
      
        
        
        
      </Menu>

        
        
       
    
    
    </>
    );
}

export default Header
